import React from 'react'
import footer from './Footer.module.css'

const Footer = () => {
  return (
    <footer className={footer.container}>
      <p>Mervin Jesus Sosa Borrero</p>
      <span>asd</span>
      {/* <img src="../../../../public/images/DH.png" alt='DH-logo' /> */}
    </footer>
  )
}

export default Footer
